import React from 'react'
import { Typography,Stack,Box } from '@mui/material'


const Home = () => {
  return (
    <>
     <Typography sx={{fontSize:"22px",fontFamily:'Inter',fontWeight:"800",color:"#1A191D"}}>Welcome, User!</Typography>
     <Stack dicrection="row">
     <Box 
          sx={{
            backgroundColor:"#FFFFFF",
            boxShadow: 2,
            borderRadius:"16px",
            padding:"24px",
            cursor:"pointer",
            transition: "all 0.2s ease-in-out",
            '&:hover': {
              transform: "scale(1.05)",
            }
          }}>
      </Box>
     </Stack>
    </>
  )
}

export default Home
